import React , {useEffect, useState} from "react";
import {  Link , useParams } from "react-router-dom";
import axios from "axios";


function Mainpage(){


    const [info , setInfo]=useState({
        arr:"" , prr:"" , arrdata :[]
      });
    
      
      function Load(){
        axios.get("/get_post" )
        .then((res)=> {
           console.log(res);
          setInfo({
            arrdata : res.data
          })
        })
        .catch((err)=>{
            console.log(err); 
          })
    }
    
        useEffect(()=>{
          Load();
        }, []
      )
    
    
    const [user , setUser]=useState({
        email:"" , pass:"" , name:""
    });

    const { id }=useParams();

    function Loaddata(){
        axios.get("/get-specific/"+id)

        .then((res)=>{
            console.log(res);
            setUser(res.data);

        })
        .catch((err)=>{
            console.log(err);
        })
    }

    useEffect(()=>{
        Loaddata();
    } , []);
    
    return(



        <>
        <div id="welcome">
            <b>Welcome {user.email}</b>
        </div>



        <div>
        <Link to={"/Post/"+id}>
        <button  id="BUT">Post</button>
        </Link>
        </div>
        
        
        <div>
        <Link to={"/AllPost/"+id}>
        <button  id="BUT">View My Items</button>
        </Link>
        </div>





        <div className="container" >




<div id="sam">
<h1>Hello</h1>
<h1>Hello</h1>
<>
{info.arrdata.map((post , pos)=>{


<>
<h1>Hello{post.email}</h1>  

<b> Hello{post.email} </b>







</>
})
}
</>


</div>





</div>


        

        </>
    )

}
export default Mainpage;
